import React from 'react';
import weatherCard from './weatherCard';
//api
// import Select, { components } from 'react-select';

export default function WeatherPast(){
    return (
        <>
        <h1>Weather Past</h1>
        <div className="form">
            <form action="">
                <select type="text"/>
                <input type="text"/>
                <weatherCard />
            </form>
        </div>
        </>

    )
}
